--
-- Function `db_ruos`.`irorganizacion`
--

DROP FUNCTION IF EXISTS `irorganizacion`;
DELIMITER $$

CREATE DEFINER=`root`@`localhost` FUNCTION `irorganizacion`(`_idresolucion` INT) RETURNS varchar(6) CHARSET utf8mb4 COLLATE utf8mb4_general_ci
BEGIN

DECLARE _idorganizacion varchar(6);



SET _idorganizacion = (

SELECT

idorganizacion

FROM organizacionessociales_detalle

where idresolucion=_idresolucion

LIMIT 1

);



  return IFNULL(_idorganizacion,'0');

END $$

DELIMITER ;

--
-- Function `db_ruos`.`mes`
--

DROP FUNCTION IF EXISTS `mes`;
DELIMITER $$

CREATE DEFINER=`root`@`localhost` FUNCTION `mes`(_d DATETIME, _locale VARCHAR(5)) RETURNS varchar(22) CHARSET utf8 COLLATE utf8_general_ci
    DETERMINISTIC
BEGIN

     SET @@lc_time_names = _locale;

     RETURN DATE_FORMAT(_d, '%M');

 END $$

DELIMITER ;

--
-- Function `db_ruos`.`vigencia`
--

DROP FUNCTION IF EXISTS `vigencia`;
DELIMITER $$

CREATE DEFINER=`root`@`localhost` FUNCTION `vigencia`(_idorganizacion varchar(6)) RETURNS varchar(30) CHARSET utf8mb4 COLLATE utf8mb4_general_ci
BEGIN



DECLARE _vigente INT ;



SET _vigente = (

SELECT

  vigente

FROM resolucion where id in(

  SELECT idresolucion FROM organizacionessociales_detalle where idorganizacion=_idorganizacion

) and vigente=1 and estado=1

order by anio,numero limit 1);



  return case when _vigente=1 then '1' else '0' end  ;

END $$

